import styled from 'styled-components'

const Container = styled.div`
    height: 60px;
`

const Wrapper = styled.div`
    padding: 10px 20px;
    display: flex;
    justify-content: space-between;
`
const Lelf = styled.div`
    flex: 1;
`

const Center = styled.div`
    flex: 1;
`
const Right = styled.div`
    flex: 1;
`

const navbar = () => {
    return (
        <Wrapper>
            <Lelf>Lorem ipsum dolor sit amet consectetur adipisicing elit. Iure delectus eius similique, impedit animi nam cum excepturi aut sequi, esse hic beatae rem tempora numquam nesciunt maxime quod reiciendis natus.</Lelf>
            <Center>Lorem ipsum dolor sit amet consectetur adipisicing elit. Sunt tempore distinctio minus? Et tempore ipsa ipsum laborum repellendus sint, pariatur doloremque assumenda, minima quo iste reprehenderit harum sequi iusto atque.</Center>
            <Right>Right</Right>

        </Wrapper>
    )
}

export default navbar
